import React from 'react';

export default function Card(cardName: any, pos: any, currentIndex: any) {
    const shiftCard = (event: any, pos: number) => {
        console.log("do something");
    };

    return (<>
        { !!pos && pos > 0 &&
            <button onClick={event => shiftCard(event, pos)}>{` < `}</button>
        }
        <span>{cardName}</span>
        { pos !== 3 &&
            <button onClick={event => shiftCard(event, pos)}>{` > `}</button>
        }
    </>);
}
